import React, { useContext, useEffect } from "react";
import { GlobalContext } from "../Context/GlobalContext";
import "./navbar.css"
import { Link, useLocation } from "react-router-dom";

const navStruct=[{name:'Profile',isActive:false},{name:"Logout"}]


function Navbar() {
const location=useLocation()


useEffect(()=>{
console.log(location.pathname)


},[location])



    const authorize = useContext(GlobalContext).authorize;





    return (
        <div className="Navbar">
            <div>
                <h1>ReactAuth</h1>
            </div>
            {!localStorage.getItem('email') ? <div>
                <div><Link to='/' ><li>Login</li></Link></div>

            </div> :
            <div>
          
              <Link to='profile' state={"profile"} ><li  ><button className="btn nav-link  ">Profile</button></li></Link>
              
            <li onClick={()=>{
                authorize.signout()
            }}>
        


        <button className="btn nav-link active">Logout</button>
                </li>
                
           
                </div>
                
            
            
          }

        </div>

    )
}
export default Navbar
